import './App.css';
import { BrowserRouter } from 'react-router-dom';
import { Routes, Route, Navigate } from 'react-router-dom';
import { Provider } from 'react-redux';

import { store } from './Redux';

import NotFound from './Pages/NotFound';
import First from './Pages/First1';
import Second from './Pages/Second2';
import Third from './Pages/Third3';
import Fourth from './Pages/Fourth';
import Fifth from './Pages/Fifth';
import Sixth from './Pages/Sixth';
import Seventh from './Pages/Seventh';
import Final from './Pages/Final';

import Layout from './Components/Layout';
import { ChoiceBook, DaysCount, HoursCount } from './Pages/Main';
function App() {
  return (
    <Provider store={store}>
      <BrowserRouter>
        <main>
          <Routes>
            <Route path="/" element={<ChoiceBook />} />

            <Route path="/0" element={<Layout />}>
              <Route index element={<HoursCount />} />
              <Route path="1" element={<DaysCount />} />
              <Route path="2" element={<Fourth />} />
              <Route path="3" element={<Fifth />} />
              <Route path="4" element={<Sixth />} />
              <Route path="5" element={<Seventh />} />
              <Route path="6" element={<Final />} />
              <Route path="*" element={<NotFound />} />
            </Route>
          </Routes>
        </main>
      </BrowserRouter>
    </Provider>
  );
}

export default App;
